class PDTagDefinition {
  // Internal index of _this_.
  final int index;
  // Creator ID.
  final String token;
  // Code in format 0xgggg00nn, where gggg is the group number, which must
  // be odd and nn is this private subgroup offset
  final int code;
  final int vrIndex;
  final VM vm;
  final String name;

  /// Creates a 'Known' [PDTagDefinition].
  const PDTagDefinition._(
      this.index, this.token, this.code, this.vrIndex, this.vm, this.name);

  bool get isKnown => true;

  int get group => code >> 16;

  int get offset => code & 0xFFFF;

  String get keyword => token;
  String get hex => hex32(code);
  String get dcm => toDcm(code);

  @override
  String toString() => '$runtimeType[$index]$dcm ${vrIdByIndex[vrIndex]} '
      '$vm: "$name" C("$token")';

